import {withOktaAuth} from "@okta/okta-react";
import React from "react";
import "../Stylesheets/User.css"

export default withOktaAuth(class User extends React.Component {




    render() {
        return (
            <div className="user-container">
                <span>{this.props.user.firstName}</span>
                <span>{this.props.user.lastName}</span>
                <span>{this.props.user.mobilePhone}</span>
                <span>{this.props.user.email}</span>

                    <span> <a href={`"https://dev-49794790.okta.com/api/v1/users/${this.props.user.oktaid}/`} target="_blank">{this.props.user.oktaid}</a></span>

                <span><button>DELETE</button></span>
            </div>
        )
    }

})
